import "package:flutter/material.dart";

void main() {
  runApp(const MyApp());
}

class MyApp extends StatelessWidget {
  const MyApp({super.key});

  @override
  Widget build(BuildContext context) {
    return const MaterialApp(
      debugShowCheckedModeBanner: false,
      home: ImageApp(),
    );
  }
}

class ImageApp extends StatefulWidget {
  const ImageApp({super.key});

  @override
  State createState() => _ImageAppState();
}

class _ImageAppState extends State {
  int _counter = 0;

  List<String> imageList = <String>["data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,"];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text("Image App"),
        backgroundColor: Colors.blue,
        centerTitle: true,
      ),
      body: Center(
        child: Column(
          mainAxisAlignment: MainAxisAlignment.center,
          children: <Widget>[
            Image.network(
              imageList[_counter],
              height: 300,
            ),
          ],
        ),
      ),
      floatingActionButton: FloatingActionButton(onPressed: () {
        if (_counter < imageList.length - 1) {
          _counter++;
        } else {
          _counter = 0;
        }
        setState(() {});
      },
      // tooltip: 'Increment',
      child: const Icon(Icons.add),),
    );
  }
}
